column8:
　合宿・遠征・旅行用に開発されていた『ENSEIシリーズ』が、今シーズン更なる進化を経て新たな『EPSシリーズ』へと生まれ変わりました。よりタフで耐摩耗性に強い生地と、コーティング生地を適材適所で使用した計算つくされたシリーズです。バックパック 30は遠征での現地で使用するセカンドバッグとして最適なサイズです。メインルームがとても大きく開きますので、アクセスがとてもしやすい仕様になっています。<br>
■カラー：BK ( BS0814 ) <br>
■サイズ：30×54×19cm<br>
※製品によって仕上りサイズに多少の誤差がありますのでご了承下さいませ。<br>
■容量：30L<br>
■素材：ポリエステル<br><br><br>検索ワード：バック かばん 鞄 旅行 修学旅行 カジュアルバッグ リュックサック リュック  デイバッグ バッグ 通勤 通学<style TYPE="text/css">

　　　<!--

　　　.inventory font {

   　　 font-size: 70% !important;

    　　color: #999 !important;

