　アディダスがプロアスリートのフィードバックをもとに研究・開発した高機能バックパックシリーズ「OPSシリーズ」。その中でもターポリン生地を採用し、耐久性と防水性を兼ね備え、迷彩柄を施したOPS SHIELD ( シールド ) シリーズ。アスリートをサポートする様々な機能も豊富に搭載。adidas独自のLoadSpringシステムを搭載し、肩へのかかる衝撃を劇的に緩和する。またシューズが収納できるデオドラント機能付きシューズポケットを底の部分に搭載。内側にトリコット素材を採用しサングラスやスマートフォンのガラス面を傷つけないよう配慮されたトップポケット、またサイドには深さの違うポケットを配し、浅いポケットには財布などすぐに取り出せるもの、そして深いポケットには折り畳み傘など長さがありかさばる物を収納。背面はノートパソコンやファイルを仕分けして収納できる、PCコンパートメントを採用し、学校・ビジネスシーンもサポートできます。部活選手がパフォーマンスを維持するための快適性を備えた高機能バックパック。それがOPSバックパック。<br>

■カラー：BL ( AZ2445 )<br>
■サイズ：29×52×16cm<br>
■容量：26L<br>
■素材：TPU、ポリエステル600D<br>
