　合宿、遠征、旅行等に人気のバッグ。よりタフで耐摩耗性に強い素材へ進化、Load springシステム搭載、メッシュをポケットの一部に採用して中の衣類等の通気性を向上、デオドラント、開口部のゆがみ防止設計により開閉向上、底にPUコーティング素材を使用しているので汚れにも強い。<br>■カラー：BK(AP3392)、GN(AP3394)、PK(AP3395)、NV(AP3393)<br>■サイズ：<br>縦/28cm、横/60cm、幅/29cm<br>      ※製品によって仕上りサイズに多少の誤差がありますのでご了承下さいませ。<br>   ■素材：ポリエステルドビー/ポリエステル900D、PUコーティング/ポリエステル600D(ポリエステル)<br>■原産国：インドネシア<br>■機能：消臭・抗菌効果 デオドラントネーム、LOADSPRING(ロードスプリング)<br><br><br>検索ワード：バック かばん 鞄 ボストンバッグ スポーツバッグ ドラムバッグ トラベルバッグ 合宿 遠征  旅行 修学旅行<style TYPE="text/css">

